package _02_nested_loops._3_for_loop_gauntlet;

public class nested_loops {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 for(int q = 0; q < 101; q++) {
			 System.out.println(q);
		 }
		 for(int w = 101; w > 0; w--) {
			 System.out.println(w);
		 }
		 for (int e = 0; e > 0; e++) {
			 
		 }
	}

}
